import React, { useEffect, useState } from "react";

export default function List(props) {
  let final = {};

  return (
    <div>
      <ul>
        {props.arr.map((i) => (
          <li key={i?.id}>
            <div style={{ display: "block" }}>
              <h4
                onClick={() => {
                  final = i;
                  props.details(final);
                }}
              >
                {i?.recipeName}
                <button
                  style={{ marginLeft: "50px" }}
                  onClick={() => {
                    final = {};
                    props.deleteObject(i?.id);
                  }}
                >
                  X
                </button>
                <button
                  style={{ marginLeft: "50px" }}
                  onClick={() => {
                    final = {};
                    props.editable(i?.id);
                  }}
                >
                  Edit
                </button>
              </h4>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}
